  return (
    <Navbar className='nav' bg="dark" variant = "dark">
    <Container>
    <Navbar.Brand style={{color: "#e6cc00", fontWeight: "bold"}} href= "#home">CryptoXchange</Navbar.Brand>
    </Container>
    </Navbar>
  )
}

export default Appbar
